import React, { Component } from "react";
import AppNavbar from "./appNavbar";
import AppSidebar from "./appSidebar";
import { Layout } from "antd";
const { Header, Footer, Sider, Content } = Layout;
class App extends Component {
  state = {
    appNavbarWidth: "100%",
    appNavbarHeight: "10%",
    appSidebarWidth: "15%",
    appSidebarHeight: "80"
  };

  render() {
    return (
      <div>
        <AppNavbar width={this.state.appNavbarWidth} />
        <AppSidebar width={this.state.appSidebarWidth} />
      </div>
    );
  }
}

export default App;
